create table social_data (
	username VARCHAR(50),
	full_name VARCHAR(50),
	birthdate DATE,
	location VARCHAR(11),
	bio TEXT,
	followers_count INT,
	following_count INT,
	profile_pic VARCHAR(50),
	status VARCHAR(9),
	join_date DATE
);

